    grid-template-columns: repeat(12, 1fr);
    gap: 1rem 1rem;
    > * {
        grid-column: span 12;
        grid-row: span 1;
    }
}
@each $label, $breakpoint, $containerWidth in $gridValues {
    @media screen and (min-width:#{$breakpoint}) {
        @for $i from 1 through 12 {
            .col#{$label}-#{$i} {
                grid-column: span + ' ' + #{$i};
            }
            .row#{$label}-#{$i} {
                grid-row: span + ' ' + #{$i};
            }
        }
    }
}

